    return `Hola, ${nombre}`;
}

const saludar2 = (nombre) => {
    return `Hola, ${nombre}`;
}
const saludar3 = (nombre) =>  `Hola, ${nombre}`;

console.log(saludar2('Vegeta'));
console.log(saludar3('Krillin'));

const getUser = () => {
    return {
        uid: 'ABD123',
